response.about:
Добро пожаловать в новую модель торговли, противоположную настоящей. Это когда покупатель ставит в известность рынок о своем намерении покупать (инициатор), а продавцы удовлетворяют его потребности... «клиент всегда прав».
После регистрации, Вы будете получать запросы на покупку в выбранной Вами рубрике (группа товаров или услуг) в режиме on-line (по мере поступления, в текущем времени) в свой кабинет. 

Второй этап — продажи  между фирмами-продавцами зарегистрированными в данной системе, где каждый может отправлять и получать запросы на покупку товара/услугу, на вакансии, на сотрудничество (дилеры, дистрибьюторы, представители, франшиза...),  на бартер , на б/у товар, на бизнес-проекты и другое. Где важную роль будет играть репутация («рейтинг доверия») продавца, а не цена.
Третий этап — планирование продаж по желаниям, намерениям, мечтам покупателей...

Преимущества данной модели торговли:
дополнительные продажи;
меньше затрат на рабочую рекламу;
кто быстрее ответит покупателю на запрос, тот и в «первых рядах»;
покупатель, который отправляет запрос — это больше чем потенциальный клиент;
полное обеспечение бизнес-процесса в одном месте (продажи, закупки, кадры, партнерство, бартер, развитие,...) с простой, дешевой, удобной формой;
«опережая будущее» 
товар, у которого подходит к концу срок годности, понизив цену, можно быстро продать (в.ч. неликвид)или обменять...
высокий рейтинг доверия позволит Вам покупать товар с отсрочкой платежа, в рассрочку, в кредит. 
.
